import React from 'react';
import './App.css';
import Navbar from './components/Navbar'
import BooksTable from './components/BooksTable'


function App(){
  useEffect(() => {
    fetch('http://localhost:3000/api/books/show-all').then((response) => response.json());
  });
  return (
    <container>
      <Navbar/>
      <BooksTable/>
    </container>
  )
}

export default App;
